import './App.css';
import { connect } from 'react-redux';
import { authFalse, authTrue } from './actions';


function App() {
  return (
    <h1>wow</h1>
  );
}

//map state
const mapStateToProps = (state) => {
  return {
    auth: state.auth,
    user: state.user,
  };
};

// map dispact
const mapDispatchToProps = (dispatch) => ({
  authTrue: () => dispatch(authTrue()),
  authFalse: () => dispatch(authFalse()),
});

export default connect(
  mapStateToProps,
  mapDispatchToProps
)(App);
